import React from 'react'
import { SideMenu, AccountMenu } from './index';
import '../assets/styles/styles.css';

import FormControlLabel from '@mui/material/FormControlLabel';
import Switch from '@mui/material/Switch';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';

type User = {
  accountName: string
  accountId:   string 
}

type Props = {
  user:          User
  setUser:       React.Dispatch<React.SetStateAction<User>>
  isEditing:     boolean
  setIsEditing:  React.Dispatch<React.SetStateAction<boolean>>
}

const MenuBar = (props: Props) => {
  return (
    <Box className="MenuBar" sx={{ flexGrow: 1 }}>
      <AppBar position="static">
        <Toolbar>
          <SideMenu user={props.user} setUser={props.setUser} />
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
            Snack
          </Typography>
          <FormControlLabel control={<Switch onClick={() => props.setIsEditing(props.isEditing ? false : true)} color="default"/>} label="編集モード" />
          <AccountMenu user={props.user} setUser={props.setUser}/>
        </Toolbar>
      </AppBar>
    </Box>
  );
}

export default MenuBar
